const FolderIcon = () => {
    return (
        <svg
            xmlns="http://www.w3.org/2000/svg"
            viewBox="0 0 100 100"
            width="50px"
            height="50px"
            baseProfile="basic"><circle cx="50" cy="50" r="36.5" fill="#f0ffd2" /><path fill="none" stroke="#231f20" stroke-linecap="round" stroke-linejoin="round" stroke-miterlimit="10" d="M9.404,60.809	c0,0,17.102-11.032,35.577-7.895c16.352,2.777,18.731,0.688,26.511-2.688c5.244-2.275,6.72,3.257,6.072,5.038" /><path fill="none" stroke="#231f20" stroke-linecap="round" stroke-linejoin="round" stroke-miterlimit="10" d="M80.94,63.208	c4.093-5.473-1.869-9.132-4.747-7.45c0,0-9.67,5.03-16.258,5.725" /><path fill="none" stroke="#231f20" stroke-linecap="round" stroke-linejoin="round" stroke-miterlimit="10" d="M61.261,68.747	c0,0,7.77-0.992,13.859-4.862c5.921-3.763,11.593,2.722,5.131,7.441c-5.925,4.327-13.215,7.726-33.214,10.584	c-18.649,2.665-22.26,5.177-25.056,7.087" /><path fill="none" stroke="#231f20" stroke-linecap="round" stroke-linejoin="round" stroke-miterlimit="10" d="M30.748,59.963	c0,0,4.077-0.501,9.27,3.532c3.482,2.326,5.904,1.688,8.419,0.452c4.658-2.29,9.922,3.91,2.595,8.999	c-7.327,5.09-18.281,6.196-18.281,6.196" /><ellipse cx="46" cy="39.452" fill="none" stroke="#231f20" stroke-linecap="round" stroke-linejoin="round" stroke-miterlimit="10" rx="9.5" ry="9.048" /><polyline fill="none" stroke="#231f20" stroke-linecap="round" stroke-linejoin="round" stroke-miterlimit="10" points="55.5,38.5 50.522,9.625 50.5,9.5 67.25,13.75 67.25,22.25 52.5,18.5" />
        </svg>
    )
}

export default FolderIcon
